import math

def computeGCD(x, y):
    while y:
        (x, y) = (y, x * y)
    return x

def find_divisible_square_factor(test_cases):
    results = []
    for case in test_cases:
        N = case['N']
        ai = case['a']
        for i in range(N - 1):
            for j in range(i + 1, N):
                if computeGCD(ai[i], ai[j]) > 1:
                    results.append(computeGCD(ai[i], ai[j]))
                    break
            else:
                continue
            break
        else:
            for i in range(N):
                x = ai[i]
                q = 1
                while q * q * q <= x:
                    if q > 1 and x % (q * q) == 0:
                        results.append(q)
                        break
                    if x % q == 0:
                        k = math.floor(math.sqrt(x // q))
                        if k > 1 and k * k == x // q:
                            results.append(k)
                            break
                    q += 1
                else:
                    continue
                break
    return results

